    // JS dla id 1

    $('#buttonone').click(function () {

        var masac = $('#masac');
        var dawka = $('#dawka');
        var jednostkaone = $('#jednostkaone');
        var jednostkatwo = $('#jednostkatwo');
        var wynikone = $('#wynikone');
        var error = 0;

        var wynikall = masac.val().replace(',', '.') * dawka.val().replace(',', '.');


        if (masac.val().replace(',', '.') > 500) {

            error = 1;

            $('.masacerror').show();

        } else {

            $('.masacerror').hide();
        }

        if (dawka.val().replace(',', '.') > 1000) {

            error = 1;

            $('.dawkaerror').show();

        } else {

            $('.dawkaerror').hide();
        }


        // kalkulacja dla µg


        if (jednostkaone.val() == 'µg' && jednostkatwo.val() == 'µg') {

            if (error == 0) {
                wynikone.text(parseFloat(wynikall).toFixed(2));
            } else {
                wynikone.text(0.00);
            }


        }

        if (jednostkaone.val() == 'µg' && jednostkatwo.val() == 'mg') {
            if (error == 0) {
                wynikone.text(parseFloat(wynikall * 0.001).toFixed(2));
            } else {
                wynikone.text(0.00);
            }
        }

        if (jednostkaone.val() == 'µg' && jednostkatwo.val() == 'g') {
            if (error == 0) {
                wynikone.text(parseFloat(wynikall * 0.000001).toFixed(2));
            } else {
                wynikone.text(0.00);
            }
        }

        if (jednostkaone.val() == 'µg' && jednostkatwo.val() == 'kg') {
            if (error == 0) {
                wynikone.text(0.00);
            } else {
                wynikone.text(0.00);
            }
        }


        jednostkatwo.change(function () {

            if (jednostkaone.val() == 'µg' && jednostkatwo.val() == 'kg') {

                var nowywynik = parseFloat(wynikone.text());

                wynikone.text((nowywynik * 100).toFixed(2));

            }


        });


    });

